import styled from "styled-components";

export const Wrapper = styled.div`
    width: auto;
    height: 50vh;
    margin-left: 0px;
    border: 1px solid;
`;

export const CalendarHead = styled.div`
    width: 100%;
    height: 40px;
    display: flex;
    justify-content: space-around;
    align-items: center;
    font-size: 24px;
`;
